import React from 'react';

const RoyalHeader = props => (
  <header className="top">
    <h1>
      ROYAL
    </h1>
    <h3 className="tagline">
      <span>{props.tagline}</span>
    </h3>
  </header>  
)
export default RoyalHeader;
